// 可拖动图标悬浮窗 - 单例实现
// 使用方式: Java.perform(() => { const floatIcon = new FloatIcon('{base64_icon}'); })

const FloatIcon = (function () {
  let instance = null;

  function FloatIcon(iconBase64, options = {}) {
    if (instance) {
      console.log("[FloatIcon] 实例已存在，返回现有实例");
      return instance;
    }

    this.iconBase64 = iconBase64;
    this.options = {
      iconSize: options.iconSize || 60,
      menuWidth: options.menuWidth || 300,
      menuHeight: options.menuHeight || 200,
      iconX: options.iconX || 100,
      iconY: options.iconY || 100,
      menuX: options.menuX || 200,
      menuY: options.menuY || 200,
      ...options,
    };

    this.context = null;
    this.windowManager = null;
    this.iconView = null;
    this.menuLayout = null;
    this.iconParams = null;
    this.menuParams = null;
    this.isMenuShown = false;
    this.isIconShown = false;

    // 拖动相关
    this.lastX = 0;
    this.lastY = 0;
    this.isDragging = false;
    this.dragStartTime = 0;

    instance = this;
    this.init();
  }

  FloatIcon.prototype.init = function () {
    try {
      Java.scheduleOnMainThread(() => {
        this.createViews();
      });
    } catch (error) {
      console.error("[FloatIcon] 初始化失败:", error);
    }
  };
  function findActivity(name) {
    return new Promise((resolve) => {
      let result = null;
      Java.choose(name, {
        onMatch(instance) {
          result = instance;
          return "stop";
        },
        onComplete() {
          resolve(result);
        },
      });
    });
  }
  FloatIcon.prototype.createViews = async function () {
    try {
      // 获取 Context 和 WindowManager
      const Context = Java.use("android.content.Context");
      const foundActivity = await findActivity(
        "com.r2games.myhero.aligames.MainActivity",
      );
      // this.context = foundActivity;

      this.context = Java.use("android.app.ActivityThread")
        .currentApplication()
        .getApplicationContext();

      this.windowManager = Java.cast(
        foundActivity.getSystemService(Context.WINDOW_SERVICE.value),
        Java.use("android.view.ViewManager"),
      );
      //   this.windowManager = foundActivity.getWindowManager();

      // 创建图标视图
      this.createIconView();

      // 创建菜单视图
      this.createMenuView();

      console.log("[FloatIcon] 初始化完成");
    } catch (error) {
      console.error("[FloatIcon] 创建视图失败:", error);
    }
  };

  FloatIcon.prototype.createIconView = function () {
    try {
      const ImageView = Java.use("android.widget.ImageView");
      const BitmapFactory = Java.use("android.graphics.BitmapFactory");
      const Base64 = Java.use("android.util.Base64");
      const LayoutParams = Java.use("android.view.WindowManager$LayoutParams");

      // 解码 base64 图标
      const decoded = Base64.decode(this.iconBase64, Base64.DEFAULT.value);
      const bitmap = BitmapFactory.decodeByteArray(decoded, 0, decoded.length);

      // 创建 ImageView
      this.iconView = ImageView.$new(this.context);
      this.iconView.setImageBitmap(bitmap);

      // 设置布局参数
      this.iconParams = LayoutParams.$new();
      this.iconParams.type = LayoutParams.TYPE_APPLICATION_OVERLAY.value;
      this.iconParams.flags =
        LayoutParams.FLAG_NOT_FOCUSABLE.value |
        LayoutParams.FLAG_NOT_TOUCH_MODAL.value;
      this.iconParams.format = Java.use(
        "android.graphics.PixelFormat",
      ).TRANSLUCENT.value;
      this.iconParams.width = this.options.iconSize;
      this.iconParams.height = this.options.iconSize;
      this.iconParams.x = this.options.iconX;
      this.iconParams.y = this.options.iconY;

      // 设置触摸事件（拖动和点击）
      this.setupIconTouchListener();
    } catch (error) {
      console.error("[FloatIcon] 创建图标视图失败:", error);
    }
  };

  FloatIcon.prototype.setupIconTouchListener = function () {
    try {
      const MotionEvent = Java.use("android.view.MotionEvent");
      const OnTouchListener = Java.use("android.view.View$OnTouchListener");
      const self = this;

      const touchListener = Java.registerClass({
        name: "com.frida.FloatIconTouchListener" + Date.now(),
        implements: [OnTouchListener],
        methods: {
          onTouch: function (view, event) {
            const action = event.getAction();

            switch (action) {
              case MotionEvent.ACTION_DOWN.value:
                self.lastX = event.getRawX();
                self.lastY = event.getRawY();
                self.isDragging = false;
                self.dragStartTime = Date.now();
                return true;

              case MotionEvent.ACTION_MOVE.value:
                const deltaX = event.getRawX() - self.lastX;
                const deltaY = event.getRawY() - self.lastY;

                if (Math.abs(deltaX) > 10 || Math.abs(deltaY) > 10) {
                  self.isDragging = true;
                  self.iconParams.x += deltaX;
                  self.iconParams.y += deltaY;
                  self.windowManager.updateViewLayout(
                    self.iconView,
                    self.iconParams,
                  );
                  self.lastX = event.getRawX();
                  self.lastY = event.getRawY();
                }
                return true;

              case MotionEvent.ACTION_UP.value:
              case MotionEvent.ACTION_CANCEL.value:
                const dragDuration = Date.now() - self.dragStartTime;
                if (!self.isDragging && dragDuration < 300) {
                  self.toggleMenu();
                }
                return true;
            }
            return false;
          },
        },
      });

      this.iconView.setOnTouchListener(touchListener.$new());
    } catch (error) {
      console.error("[FloatIcon] 设置触摸监听失败:", error);
    }
  };

  FloatIcon.prototype.createMenuView = function () {
    try {
      const LinearLayout = Java.use("android.widget.LinearLayout");
      const TextView = Java.use("android.widget.TextView");
      const Button = Java.use("android.widget.Button");
      const LayoutParams = Java.use("android.view.WindowManager$LayoutParams");
      const Color = Java.use("android.graphics.Color");
      const JString = Java.use("java.lang.String");

      // 创建菜单容器
      this.menuLayout = LinearLayout.$new(this.context);
      this.menuLayout.setOrientation(LinearLayout.VERTICAL.value);
      // this.menuLayout.setBackgroundColor(Color.parseColor("#CC000000"));
      this.menuLayout.setBackgroundColor(Color.parseColor("#00000000")); // 完全透明
      // 标题
      const titleText = TextView.$new(this.context);
      titleText.setText(JString.$new("悬浮菜单"));
      titleText.setTextSize(18);
      titleText.setTextColor(Color.WHITE.value);
      titleText.setPadding(20, 20, 20, 20);
      this.menuLayout.addView(titleText);

      // 最小化按钮
      const minimizeBtn = Button.$new(this.context);
      minimizeBtn.setText(JString.$new("最小化"));
      minimizeBtn.setTextSize(16);
      minimizeBtn.setTextColor(Color.WHITE.value);
      minimizeBtn.setBackgroundColor(Color.parseColor("#FF4444"));

      const btnParams = Java.use(
        "android.widget.LinearLayout$LayoutParams",
      ).$new(
        Java.use("android.view.ViewGroup$LayoutParams").MATCH_PARENT.value,
        Java.use("android.view.ViewGroup$LayoutParams").WRAP_CONTENT.value,
      );
      btnParams.setMargins(20, 10, 20, 20);
      minimizeBtn.setLayoutParams(btnParams);

      const self = this;
      const OnClickListener = Java.use("android.view.View$OnClickListener");
      const clickListener = Java.registerClass({
        name: "com.frida.FloatMinimizeClickListener" + Date.now(),
        implements: [OnClickListener],
        methods: {
          onClick: function (view) {
            self.hideMenu();
            self.showIcon();
          },
        },
      });

      minimizeBtn.setOnClickListener(clickListener.$new());
      this.menuLayout.addView(minimizeBtn);

      // 布局参数
      this.menuParams = LayoutParams.$new();
      this.menuParams.type = LayoutParams.TYPE_APPLICATION_OVERLAY.value;
      this.menuParams.flags =
        LayoutParams.FLAG_NOT_FOCUSABLE.value |
        LayoutParams.FLAG_NOT_TOUCH_MODAL.value;

      this.menuParams.format = Java.use(
        "android.graphics.PixelFormat",
      ).TRANSLUCENT.value;
      this.menuParams.width = this.options.menuWidth;
      this.menuParams.height = this.options.menuHeight;
      this.menuParams.x = this.options.menuX;
      this.menuParams.y = this.options.menuY;
    } catch (error) {
      console.error("[FloatIcon] 创建菜单视图失败:", error);
    }
  };

  FloatIcon.prototype.showIcon = function () {
    if (this.isIconShown) return;
    try {
      this.windowManager.addView(this.iconView, this.iconParams);
      this.isIconShown = true;
      console.log("[FloatIcon] 图标已显示");
    } catch (error) {
      console.error("[FloatIcon] 显示图标失败:", error);
    }
  };

  FloatIcon.prototype.hideIcon = function () {
    if (!this.isIconShown) return;
    try {
      this.windowManager.removeView(this.iconView);
      this.isIconShown = false;
      console.log("[FloatIcon] 图标已隐藏");
    } catch (error) {
      console.error("[FloatIcon] 隐藏图标失败:", error);
    }
  };

  FloatIcon.prototype.showMenu = function () {
    if (this.isMenuShown) return;
    try {
      this.windowManager.addView(this.menuLayout, this.menuParams);
      this.isMenuShown = true;
      console.log("[FloatIcon] 菜单已显示");
    } catch (error) {
      console.error("[FloatIcon] 显示菜单失败:", error);
    }
  };

  FloatIcon.prototype.hideMenu = function () {
    if (!this.isMenuShown) return;
    try {
      this.windowManager.removeView(this.menuLayout);
      this.isMenuShown = false;
      console.log("[FloatIcon] 菜单已隐藏");
    } catch (error) {
      console.error("[FloatIcon] 隐藏菜单失败:", error);
    }
  };

  FloatIcon.prototype.toggleMenu = function () {
    if (this.isMenuShown) {
      this.hideMenu();
    } else {
      this.showMenu();
    }
  };

  FloatIcon.prototype.show = function () {
    Java.scheduleOnMainThread(() => {
      this.showIcon();
      //   this.showMenu();
    });
  };

  FloatIcon.prototype.destroy = function () {
    try {
      if (this.isMenuShown) this.hideMenu();
      if (this.isIconShown) this.hideIcon();
      instance = null;
      console.log("[FloatIcon] 已销毁");
    } catch (error) {
      console.error("[FloatIcon] 销毁失败:", error);
    }
  };

  return FloatIcon;
})();

// 导出
if (typeof module !== "undefined" && module.exports) {
  module.exports = FloatIcon;
}

Java.scheduleOnMainThread(() => {
  const iconBase64 =
    "";

  const floatIcon = new FloatIcon(iconBase64, {
    iconX: 50,
    iconY: 100,
    menuX: 200,
    menuY: 200,
    menuWidth: 80,
    menuHeight: 25,
  });

  setTimeout(() => {
    floatIcon.show();
  }, 1000);

  console.log("[FloatIcon] 悬浮图标已创建");
});
